import React from 'react'

const Episodes = ({id}) => {
    let url=`https://api.jikan.moe/v3/anime/${id}/episodes`;

    const [details, setDetails] = useState([]);

    useEffect(() =>
    {
        (async function()
        {

            try{
                const res = await axios.get(url);
                setDetails(res.data.episodes);
                console.log(res.data);
            }
            catch(err)
            {
                console.log(err);
            }

        })();
    }, [url])

    return (
        <div>
            {details.map((detail)=>{return <div key={detail.episode_id}>{detail.title}</div>})}
        </div>
    )
}

export default Episodes;
